        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. PEDAGOGICAL OBJECTIVES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine of the programme </h3>
                <p class=""description""> 
                    Education must be a means to give children and adults the opportunity to become active participants in the transformation of the society in which
                    they live. Learning must also take into account the values, attitudes and behaviors that enable people to learn to live together in a world
                    characterized by diversity and pluralism. This field");
            WriteLiteral(@" of knowledge is what the educational sciences want to explore because there are several
                    sciences that contribute in one way or another to make education conform to what we want. It is thus to equip the professionals of education so
                    that they succeed better their noble mission of education that the Master of Arts in education a two (2) year course is proposed with 3 options:
                    Analysis and design in education and training, Education in Emergencies and Organization Systems Engineering.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Program Objectives </h3>
                <h3 class=""smaller_heading""> II.2.1. General Objective </h3>
                <p class=""description""> 
                    This course aims at a specialization in the field of the professions of education but also of the research in education with as logical prospect a
                    con");
            WriteLiteral(@"tinuation of studies in doctorate.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Specific Objectives </h3>
                <p class=""description""> 
                    <strong> Commun run to the mention </strong><br/>
                    This course aims to enable students:
                </p>
                <ul class=""one_list"">
                    <li> 
                        To acquire a solid culture in the field of educational sciences,
                    </li>
                    <li> 
                        Master the foundation of human and social sciences knowledge dealing with education and training issues,
                    </li>
                    <li> 
                        Be able to analyze complex situations through the control of research methods (data collection and processing),
                    </li>
                    <li> 
                        Conduct, write and present research,
                     </li>
                ");
            WriteLiteral(@"    <li> 
                        Develop an excellent mastery of writing (Writing a Study and Research Work) .
                    </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approach to the program </h3>
                <p class=""description""> 
                    While the Bachelor of Arts in Education is a general education, open to the many disciplines that make up the sciences of education, the course
                    of Master allows to deepen specific aspects and build one’s own professional profile, in tune with the current problems of education.
                    The Master's First Year (M1) Education Sciences is a training that extends the courses taught in Bachelor's Degree Education Sciences. The
                    knowledge and skills targeted in this M1 are theoretical and methodological. They are, on the one hand, generalist (disciplinary approaches,
                    epistemology, methodology) and open, on the other hand, to a beginning of ");
            WriteLiteral(@"specialization according to the course envisaged in M2.
                    The Master 1 is for students who wish to persue the following options at the end of the first year:
                </p>
                <ul class=""one_list"">
                    <li> 
                        Master 2 Analysis and Design in Education and Training,
                    </li>
                    <li> 
                        Master 2 Education in Emergencies,
                    </li>
                    <li> 
                        Master 2 Organization Systems Engineering.
                    </li>
                </ul>

                <p class=""description""> 
                    These three M2 options offer differentiated choices of qualification, skill building and professionalisation in the field of educational and training
                    activities in professional fields. These pathways, built around the specific needs of the professional world in education, training, social work and
      ");
            WriteLiteral(@"              health, are also intended to develop scientific research skills for pursuing doctoral studies..
                </p>

